from pedantic import validate

class Library:
    def __init__(self):
        self.books = []

    @validate
    def add_book(self, book_id: int, book_title: str) -> None:
        self.books.append({'id': book_id, 'title': book_title})

    @validate
    def remove_book(self, book_id: int) -> bool:
        for book in self.books:
            if book['id'] == book_id:
                self.books.remove(book)
                return True
        return False
